    }, 
    {
        title: "favourite", 
        icon: <FavoriteIcon />
    }, 
    {
        title: "logout", 
        icon: <LogoutIcon />
    }

]

export default function ProfileNavigation() {
  return (
    <div>ProfileNavigation</div>
  )
}
